XECUTABLE_NAME}\"\n\n\n# Copy the binary to the other architecture folder to have a complete framework in both.\ncp -a \"${BUILT_PRODUCTS_DIR}/${SF_WRAPPER_NAME}/Versions/A/${SF_EXECUTABLE_NAME}\" \"${SF_OTHER_BUILT_PRODUCTS_DIR}/${SF_WRAPPER_NAME}/Versions/A/${SF_EXECUTABLE_NAME}\"\n\n\n#and copy the framework somewhere else\n#+u triggers error for unbound variables, so specify in any case\nEXPORT_DIR=${FRAMEWORK_EXPORT_DIR:-}\nif [[ -n \"${EXPORT_DIR}\" ]]; then\necho \"### GOT FRAMEWORK DIR: ${EXPORT_DIR} ###\"\nmkdir -p \"${EXPORT_DIR}\"\ncp -avR \"${BUILT_PRODUCTS_DIR}/${SF_WRAPPER_NAME}\" \"${EXPORT_DIR}\"\ncp -avR \"${BUILT_PRODUCTS_DIR}/${SF_BUNDLE_NAME}\" \"${EXPORT_DIR}\"\nelse\necho \"### NO FRAMEWORK DIR PROVIDED: ${EXPORT_DIR} ###\"\nfi\n";
